import { useState } from "react";
import './App.css';



function Game() {
    const [poeng, setPoeng] = useState('0');
    return (
        <>
            <div id="top">
                <button class="knapper"><p>Spill</p></button>
                <button class="knapper"><p>Instruksjonsvideo</p></button>
                <button class="knapper"><p>FAQ</p></button>
                <button class="knapper"><p>Lover og regler</p></button>
                <button class="knapper"><p>Logg ut</p></button>
            </div>

            
        </>
    )
}

export default Game;
